import re

def extract_climate_data(text):
    temp_pattern = re.compile('(\\d+.\\d+) degrees Celsius global temperature rise')
    co2_pattern = re.compile('(\\d+.\\d+) gigatonnes of CO2 emissions')
    ice_sheet_loss_pattern = re.compile('(\\d+.\\d+) trillion tonnes of ice sheet loss')
    temp_search = re.findall(temp_pattern, text)
    co2_search = re.findall(co2_pattern, text)
    ice_sheet_loss_search = re.findall(ice_sheet_loss_pattern, text)
    if temp_search or co2_search or ice_sheet_loss_search:
        return {'global_temperature_rise': float(temp_search[0]), 'co2_emissions': float(co2_search[0]), 'ice_sheet_loss': float(ice_sheet_loss_search[0])}
    else:
        return None

